    function ProcessCsv(props) {
       console.log('process')

       const {details, dta} = props
       let high = false
     
         for (let d of dta) {
             //console.log(dta)
             //console.log(d)
             if (details.includes("+" + d.Prefix)) {
                high = true
                break;
             }
             else {
               //console.log('csv')
             }
         }

        if(high) {return   <p>High Risk: High</p>;    }

        else{return <p>Bandwidth High Risk else: None</p>;  }
    
        }

 export default ProcessCsv
